package cn.com.open.openpaas.payservice.app.channel.yeepay.ehking;

import java.awt.image.BufferedImage;
import java.io.ByteArrayInputStream;
import java.io.FileInputStream;
import java.io.FileOutputStream;
import java.io.IOException;
import java.io.InputStream;
import java.io.OutputStream;

import javax.imageio.ImageIO;
import javax.servlet.http.HttpServletResponse;

import sun.misc.BASE64Decoder;
import sun.misc.BASE64Encoder;

public class Base64Image {
	  private static BASE64Encoder encoder = new sun.misc.BASE64Encoder();  
	  private static BASE64Decoder decoder = new sun.misc.BASE64Decoder();  
    public static void main(String[] args) {
        // 测试从Base64编码转换为图片文件
        String strImg = "";
        GenerateImage(strImg, "D:\\wangyc1.jpg");
        
        // 测试从图片文件转换为Base64编码
        //System.out.println(GetImageStr("d:\\wangyc.jpg"));
    }

    public static String GetImageStr(String imgFilePath) {// 将图片文件转化为字节数组字符串，并对其进行Base64编码处理
        byte[] data = null;
        
        // 读取图片字节数组
        try {
            InputStream in = new FileInputStream(imgFilePath);
            data = new byte[in.available()];
            in.read(data);
            in.close();
        } catch (IOException e) {
            e.printStackTrace();
        }
        
        // 对字节数组Base64编码
        BASE64Encoder encoder = new BASE64Encoder();
        return encoder.encode(data);// 返回Base64编码过的字节数组字符串
    }

    public static boolean GenerateImage(String imgStr, String imgFilePath) {// 对字节数组字符串进行Base64解码并生成图片
        if (imgStr == null) // 图像数据为空
            return false;
        BASE64Decoder decoder = new BASE64Decoder();
        try {
            // Base64解码
            byte[] bytes = decoder.decodeBuffer(imgStr);
            for (int i = 0; i < bytes.length; ++i) {
                if (bytes[i] < 0) {// 调整异常数据
                    bytes[i] += 256;
                }
            }
            // 生成jpeg图片
            OutputStream out = new FileOutputStream(imgFilePath);
            out.write(bytes);
            out.flush();
            out.close();
            return true;
        } catch (Exception e) {
            return false;
        }
    }
    /** 
     * 将BASE64加密字符串转换为图片. 
     * @param base64String 
     * @param imagePath 图片生成路径. 
     * @param format 图片格式. 
     */  
    public static void convertByteToImage(String base64String,  HttpServletResponse respnose) {  
        byte[] bytes = null;  
        ByteArrayInputStream bais = null;  
        BufferedImage bi = null;  
        try {  
            //bytes = decoder.decodeBuffer(base64String);  
        	  // Base64解码
            bytes = decoder.decodeBuffer(base64String);
            bais = new ByteArrayInputStream(bytes);  
            bi = ImageIO.read(bais); 
            //bi = ImageIO.read(bais);  
            ImageIO.write(bi, "png", respnose.getOutputStream());   
        } catch (IOException e) {  
        } finally {  
            try {  
                if(bais != null) {  
                    bais.close();  
                    bais = null;  
                }  
            } catch (Exception e) {  
                System.out.println("关闭文件流发生异常: " + e);  
            }  
        }  
    }  
}